{
  "application": "SLURM",
  "details": {
    "language": "Bash",
    "purpose": "Run array jobs with different inputs",
    "resources": {
      "nodes": 1,
      "tasks_per_node": 4,
      "cpus_per_task": 2,
      "time": "00:05:00",
      "memory": "50000 MB",
      "environment": {
        "conda": "loaded",
        "OMP_NUM_THREADS": 2,
        "EXE": "invertc",
        "JOB_ID": "SLURM_ARRAY_JOB_ID or SLURM_JOB_ID",
        "SUB_ID": "SLURM_ARRAY_TASK_ID or 1",
        "LIST": "in_list (default) or user-defined"
      },
      "dependencies": {
        "conda": "for recent python version",
        "invertc": "C program for matrix inversions",
        "tymer": "utility for time measurement"
      }
    },
    "input": "in_list file containing data for each subjob",
    "output": {
      "structure": {
        "top_level_directory": "named after JOB_ID",
        "subdirectories": "named after SUB_ID",
        "files": [
          "envs": "environment variables",
          "input": "input data for the subjob",
          "myscript": "copy of the script",
          "node": "hostname of the node",
          "output": "output from the program",
          "timer": "timing information"
        ]
      }
    },
    "example_invocation": "sbatch -A account --array=1-24 uselist.sh"
  }
}
